import React from 'react';
import './Header.css';

export default function Header() {
    return (
        <div>
            <div class="grid-item">
                <img src="/images/MathLaw.PNG"></img>
                <img src="/images/logo.PNG" style={{marginBottom: "33px", marginLeft: "30px"}}></img>
            </div>
            <div class="grid-item">

            </div>
            <div class="grid-item">
                <button type="button" className="topssignUp">Log In</button>
                <button type="button" className="toplogIn">Sign Up</button>
            </div>
        </div>
    );
}
